description:
The Class 57 for Train Simulator is available in Rail Tours Company maroon livery and features a number of exciting scenarios, including rail tours along the famous and spectacular Settle to Carlisle line.

Settle-Carlisle (available separately) is required to play the included scenarios.


Please support the developers and buy some of their content if you can afford it.


